import React from "react";

const Footer = () => {
  const handleLogout = () => {
    // Clear local storage
    localStorage.clear();

    // Clear cookies
    document.cookie.split(";").forEach((cookie) => {
      document.cookie = cookie
        .replace(/^ +/, "")
        .replace(/=.*/, "=;expires=Thu, 01 Jan 1970 00:00:00 UTC; path=/");
    });

    alert("You have been logged out.");
  };

  return (
    <footer className="bg-gray-800 text-white text-sm p-4  w-[100vw] h-[15vh] bottom-0 right-0">
      <button type="button">logout</button>
      <p>&copy; Avilambh2025</p>
      <p className="text-center">
        <strong>Owner:</strong> Mr 979797XXXX
      </p>
    </footer>
  );
};

export default Footer;
